  [],\n\t\"revision_timestamp\": \"2016-07-27T22:50:10.514047\",\n\t\"name\": \"rice-lake-national-wildlife-refuge-narrative-report-january-april-1959\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Rice Lake NWR
  outlines Refuge accomplishments from January through April of 1959. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and wildfires. Resource management is outlined;
  topics include haying, fur harvesting, and timber removal. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, and hunting.
  N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
